import styles from "./Header.module.scss";
import Logo from "./logo.svg";

const HeaderComponent = () => {
	return (
		<div className={styles.header}>
			<div className={styles.logo}>
				<Logo />
			</div>
		</div>
	);
};
export default HeaderComponent;
